import React from 'react';

const LoginForm = () => {
    return (
        <>
            <div className="LoginForm">
                <div className="modal-wrapper">
                    
                </div>
            </div>
            <style global jsx>
                {`
                    .LoginForm {
                        width: 400px;
                        height: 600px;
                        margin: 0 auto;
                        top: 50%;
                        margin-top: 250px;
                    }
                    .modal-wrapper{
                        width: 400px;
                        background-color: #2A2D33;
                        border-radius: 40px;
                        font-family: $font;
                        color: #515866;
                        box-shadow: 0 40px 80px rgba(0,0,0,0.5);
                    }
                `}
            </style>
        </>
    )
}

export default LoginForm;
